import React, { useState } from 'react';

const SetupMatch: React.FC = () => {
  const [currentRound, setCurrentRound] = useState<string>('');

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log('Current Round:', currentRound);
    // Gửi dữ liệu đến backend
  };

  return (
    <div className="card p-6 shadow-lg bg-white">
      <h2 className="text-2xl font-bold mb-4">Setup Match</h2>
      <form onSubmit={handleSubmit}>
        <div className="mb-4">
          <label htmlFor="currentRound" className="block text-lg mb-2"></label>
          <input
            type="text"
            id="currentRound"
            value={currentRound}
            onChange={(e) => setCurrentRound(e.target.value)}
            className="border rounded p-2 w-full"
            required
          />
        </div>
        <button
          type="submit"
          className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600"
        >
          Update Round
        </button>
      </form>
    </div>
  );
};

export default SetupMatch;
